import React from 'react';
import PropTypes from 'prop-types';


class Contenido extends React.Component {
	static PropTypes = {
    body: PropTypes.object.isRequired
  };
  render() {
  	const {body} = this.props;
    return (
    	<div>
    		{body}
    	</div>
    );
  }
}
export default Contenido;
